INSERT INTO `gfwu2_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(1, 62, 'Top up tài khoản', 'top-up-tai-kho-n', '<div>\r\n<div>\r\n<div>- Nộp tiền mặt hoặc chuyển khoản.</div>\r\n<div>- Nội dung: Ten chu tai khoan - SDT - Nap tai khoan</div>\r\n<div>Ví dụ: Nguyen Van A - 0987654321 - Nap tai khoan</div>\r\n<div> </div>\r\n<div>- Tên tài khoản: Dương Thị Thúy</div>\r\n</div>\r\n</div>\r\n<div>\r\n<div>- Vietcombank: 0931004190575 - Chi Nhánh Hoàng Mai </div>\r\n<div>\r\n<div>- Số tiền topup tối thiểu: 500.000đ/lần</div>\r\n</div>\r\n<div> </div>\r\n</div>', '', 1, 8, '2017-08-17 04:47:20', 846, '', '2017-09-29 07:42:15', 1, 0, '0000-00-00 00:00:00', '2017-08-17 04:47:20', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 4, '', '', 1, 188, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(2, 63, 'Xử lý hóa đơn tài chính', 'x-ly-hoa-don-tai-chinh', '<div>Đối với các lịch yêu cầu hóa đơn YCar phải xử lý cho khách thay lái xe, YCar sẽ áp dụng một trong 2 phương án:</div>\r\n<div>+ <span style=\"color: #0000ff;\"><b>Phương án 10%</b></span> = 10% cước.</div>\r\n<div>+ <span style=\"color: #ff0000;\"><b>Phương án 20%</b></span> = 20% cước.</div>\r\n<div>+ Phí chuyển phát = <b><span style=\"color: #0000ff;\">0 đồng (</span></b><b><span style=\"color: #0000ff;\">do YCar xuất hóa đơn điện tử</span></b>)</div>\r\n<div> </div>\r\n<p class=\"item item-text-wrap ng-binding\">- Lịch <b>hóa đơn ngay</b>: Lái xe phải xử lý để khách không gọi lên YCar đòi hóa đơn. Nếu khách gọi lên đòi hóa đơn thì YCar sẽ thực hiện xuất luôn hóa đơn cho khách và cắt tiền theo phương án <b>20%</b>.</p>\r\n<div> </div>\r\n<div>- Lịch <b>không yêu cầu hóa đơn ngay</b>:</div>\r\n<div>+ Nếu lái xe có thể xuất luôn hóa đơn cho khách nhưng khách không muốn lấy luôn mà yêu cầu gửi cho khách sau, lái xe được phép thu <b>10.000đ phí chuyển phát</b> để có chi phí chuyển phát hóa đơn cho khách.</div>\r\n<div>+ Nếu lái xe không thể xuất hóa đơn luôn cho khách thì phải xử lý dứt điểm với khách trong vòng <b><span style=\"color: #008000;\">05 ngày làm việc</span></b> kể từ ngày đón khách. <b><span style=\"color: #0000ff;\">Sau 05 ngày làm việc</span></b>, nếu khách vẫn chưa nhận được hóa đơn <b><span style=\"color: #0000ff;\">vì bất cứ lý do gì</span></b>, công ty sẽ xuất hóa đơn cho khách và cắt tiền lái xe theo phương án <b>20%</b>.</div>\r\n<div>+ Nếu lái xe không thể xuất được hóa đơn thì có thể chủ động nhờ YCar xử lý luôn và YCar sẽ cắt tiền theo phương án <span style=\"color: #0000ff;\"><b>10%</b></span> (<i><b>chỉ áp dụng nếu lái xe chủ động yêu cầu YCar trước khi khách gọi lên</b></i>). YCar sẽ xuất luôn cho khách trong giờ hành chính bằng hóa đơn điện tử.</div>\r\n<div> </div>\r\n<div>Khi thực hiện cắt tiền hóa đơn, YCar sẽ gọi điện thông báo và SMS cho lái xe để lái xe nắm được.</div>\r\n<div> </div>\r\n<div>Áp dụng từ 6/4/2017.</div>\r\n<div>Trân trọng cảm ơn.</div>', '', 1, 8, '2017-08-17 04:47:58', 846, '', '2017-09-06 09:15:28', 1, 0, '0000-00-00 00:00:00', '2017-08-17 04:47:58', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 0, '', '', 1, 20, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(3, 64, 'Chính chủ lái xe và tài khoản', 'chinh-ch-lai-xe-va-tai-kho-n', '<p class=\"item item-text-wrap ng-binding\">1. Áp dụng đối với các tài khoản Bid<b><span style=\"color: #ff0000;\"> đăng ký 01 xe</span></b>:</p>\r\n<div> </div>\r\n<div>2. Chủ tài khoản phải <b><span style=\"color: #0000ff;\">trực tiếp đón khách</span></b>:</div>\r\n<div>+ Số điện thoại đăng ký BID phải liên lạc được trong thời gian nhận lịch và đón khách.</div>\r\n<div>+ Số điện thoại đăng ký BID phải đi theo xe khi đón khách <i><b><span style=\"color: #800000;\">(công ty không chấp nhận lý do khi tổng đài gọi điện thì chủ tài khoản ở nhà và trả lời là lái xe của anh đón khách)</span></b></i></div>\r\n<div> </div>\r\n<div>3. Dùng đúng xe đã đăng ký BID đón khách (YCar sẽ nhắn thông tin xe cho khách)</div>\r\n<div> </div>\r\n<div>4. Chế tài: <span style=\"color: #0000ff;\"><b>phạt 100.000đ/lần</b></span> + khóa TK Bid <span style=\"color: #0000ff;\"><b>10 ngày</b></span></div>\r\n<div> </div>\r\n<div>Đây là quy định ngay từ đầu đối với các xe ký hợp đồng với YCar nhưng chưa được thực hiện nghiêm túc, dẫn đến tình trạng chuyển khách tràn lan, ảnh hưởng đến chất lượng dịch vụ.</div>\r\n<div> </div>\r\n<div>Vì vậy công ty sẽ tăng cường giám sát để đảm bảo chất lượng dịch vụ.</div>\r\n<div>Mọi thắc mắc xin liên hệ: <b>0903 287 499</b>.</div>', '', 0, 8, '2017-08-17 04:48:28', 846, '', '2017-09-06 09:14:46', 1, 0, '0000-00-00 00:00:00', '2017-08-17 04:48:28', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 3, '', '', 1, 29, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(4, 65, 'Chương trình đại lý', 'chuong-trinh-d-i-ly', '<p class=\"item item-text-wrap ng-binding\">1. Hỗ trợ ae lái xe điều lịch riêng của mình.</p>\r\n<div> </div>\r\n<div>2. Lái xe bắn lịch cho YCar:</div>\r\n<div><span style=\"color: #008080;\"><b> </b></span></div>\r\n<div><span style=\"color: #008000;\"><b>a. Lợi ích:</b></span></div>\r\n<div>- Lịch sẽ được điều sao cho <span style=\"color: #ff6600;\">TIỀN CẮT CAO NHẤT</span></div>\r\n<div>- Tỷ lệ ăn chia: Lái xe <b><span style=\"color: #0000ff;\">(70%)</span></b> &amp; YCar <b><span style=\"color: #0000ff;\">(30%)</span></b> và phí cho NBC <span style=\"color: #ff6600;\"><b>TỐI ĐA: 100.000đ</b></span> và <span style=\"color: #ff6600;\">TỐI THIỂU: <b>20.000đ/lịch</b></span></div>\r\n<div>- Toàn bộ tiền cắt sẽ được thể hiện rõ ràng trong \"<span style=\"color: #ff6600;\">TK BẮN LỊCH</span>\", được tổng kết hàng tháng và thanh toán trong vòng 10 ngày của tháng tiếp theo.</div>\r\n<div>- YCar sẽ điều xe đúng yêu cầu và đúng giờ.</div>\r\n<div>- Lịch không thu tiền, YCar chỉ thu phí <span style=\"color: #ff0000;\">30.000đ/lịch</span> sân bay và <span style=\"color: #ff0000;\">50.000đ/lịch</span> đường dài</div>\r\n<div><span style=\"color: #008000;\"><b> </b></span></div>\r\n<div><span style=\"color: #008000;\"><b>b. Thực hiện:</b></span></div>\r\n<div>- Lái xe vào link: <b><span style=\"color: #0000ff;\">www.driver.ycar.vn</span></b> và Login bằng User và Password của TK Bid</div>\r\n<div>- Sau khi login, có 3 lựa chọn:</div>\r\n<div>+ Yêu cầu tổng đài gọi lại: Click vào biểu tượng cái điện thoại, phía trên, bên trái màn hình =&gt; Tổng đài sẽ gọi lại trong vòng 5 phút để lấy thông tin và điều xe.</div>\r\n<div>+ Chuyển lịch có thông tin cơ bản: Tổng đài sẽ gọi lại cho lái xe để xác nhận và bổ sung thông tin =&gt; đưa lên Bid.</div>\r\n<div>+ Lịch GẤP: gọi trực tiếp lên tổng đài để yêu cầu điều xe gấp: <b>0903 287 499</b></div>\r\n<div><span style=\"color: #008000;\"><b>c. Hỗ trợ:</b></span></div>\r\n<div>- Mọi thắc mắc về chính sách: gọi <b>0903 287 499 </b>để được giải thích cụ thể.</div>\r\n<div>- Mọi vướng mắc về tổng đài trong quá trình nhận lịch hoặc điều xe, gọi <b>0903 287 499 </b>để được giải quyết.</div>', '', 0, 8, '2017-08-17 04:49:48', 846, '', '2017-09-06 10:01:40', 1, 0, '0000-00-00 00:00:00', '2017-08-17 04:49:48', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 2, '', '', 1, 19, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(5, 66, 'Nhận lịch đón sân bay', 'nh-n-l-ch-don-san-bay', '<div>Lịch Đón mà khách \"<span style=\"color: #0000ff;\"><b>đứng sảnh</b></span>\" hoặc \"<span style=\"color: #0000ff;\"><b>đang lấy đồ</b></span>\":</div>\r\n<div>- Lái xe phải luôn sẵn sàng trước khi tham gia nhận lịch.</div>\r\n<div>- Lái xe trả giá cẩn thận, nếu trả sai giá dẫn đến việc phải đưa lên bid lại, mất thời gian dẫn đến khả năng trượt khách cao.</div>\r\n<div>- Sau khi nhận được lịch, trong vòng <span style=\"color: #0000ff;\"><b>3 phút</b></span> lái xe phải liên hệ với khách, trong vòng <span style=\"color: #0000ff;\"><b>7 phút</b></span> lái xe phải sẵn sàng trong sảnh đón khách.</div>\r\n<div>+ Nếu trượt khách: NBC sẽ <span style=\"color: #ff6600;\"><b>phạt tiền cắt</b></span>.</div>\r\n<div>+ Nếu không trượt, lái xe khác nhận lịch với giá cao hơn giá bạn đưa ra, NBC sẽ <span style=\"color: #ff6600;\"><b>phạt tiền chênh lệch</b></span> giữa giá thắng thầu của 2 lần đưa lên bid.</div>\r\n<div> </div>\r\n<div>Viết biển tên đón khách:</div>\r\n<div>Tất cả <span style=\"color: #0000ff;\"><b>lịch </b></span><b><span style=\"color: #0000ff;\">đón khách nước ngoài</span><span style=\"color: #000000;\"> </span></b>từ sân bay Nội Bài, công ty đều đã thông báo với khách là có lái xe cầm biển đợi khách ở sảnh đến. Vì vậy, đề nghị anh em lái xe chuẩn bị công cụ viết biển tên khi nhận lịch đón, vì lịch đón có thể là khách người Việt hoặc người nước ngoài.</div>\r\n<div>- Lái xe phải viết biển tên đón khách nếu khách là người nước ngoài, dù có số điện thoại của khách hay không.</div>\r\n<div>\r\n<div>- Biển đón phải từ khổ A4 trở lên, chữ viết bằng <span style=\"color: #ff0000;\"><b>bút dạ đen, nét to</b></span> để khách dễ nhận ra.</div>\r\n<div> </div>\r\n<div>Thanks</div>\r\n</div>', '', 0, 8, '2017-08-17 04:50:17', 846, '', '2017-09-06 09:12:10', 1, 49, '2017-09-12 07:42:27', '2017-08-17 04:50:17', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 2, 1, '', '', 1, 15, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(6, 67, 'Lịch tiễn sân bay theo phương án PHỤ TRỘI', 'l-ch-ti-n-san-bay-theo-phuong-an-ph-tr-i', '<p class=\"item item-text-wrap ng-binding\">Quy ước về lịch tiễn sân bay theo phương án <b><span style=\"color: #0000ff;\">PHỤ TRỘI</span></b>:</p>\r\n<div>1. Giá niêm yết là giá cho 30km đầu tiên</div>\r\n<div>2. Những km tiếp theo sẽ tính <span style=\"color: #008000;\"><b>10.000đ/k</b><b>m</b></span> xe 4 chỗ và <span style=\"color: #ff0000;\"><b>12.000đ/km</b></span> xe 7 chỗ</div>\r\n<div> </div>\r\n<div>Vì vậy, khi ae lái xe nhận lịch có chữ \"phụ trội\" thì nhớ bấm đồng hồ khi bắt đầu đón khách để khi lên sân bay tính thêm phí phụ trội (nếu có)</div>\r\n<div> </div>\r\n<div>Phương án này thường áp dụng cho những lịch xa và khách chọn phương án phụ trội.</div>\r\n<div> </div>\r\n<div>Cảm ơn.</div>', '', 0, 8, '2017-08-17 04:51:04', 846, '', '2017-08-17 04:51:04', 0, 0, '0000-00-00 00:00:00', '2017-08-17 04:51:04', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_optio