(7, 71, 'Giới thiệu', 'gioi-thieu', '', '', 0, 2, '2017-08-21 04:30:46', 1, '', '2017-08-21 04:30:46', 0, 0, '0000-00-00 00:00:00', '2017-08-21 04:30:46', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 1, '', '', 1, 11, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(8, 76, 'QUY ĐỊNH LÁI XE', 'quy-dinh-lai-xe', '<p><strong>QUY ĐỊNH LÁI XE</strong></p>\r\n<ol>\r\n<li>Lái xe không tiếp thị khách.</li>\r\n</ol>\r\n<p>- Lái xe tuyệt đối không tiết lộ giá nhận chuyến, không tiếp thị hay mời khách.</p>\r\n<ol start=\"2\">\r\n<li>Lái xe đón đúng loại xe đăng ký.</li>\r\n</ol>\r\n<p>- Tuyệt đối không mua hộ chuyến khi chưa có sự đồng ý của tổng đài.</p>\r\n<p>- Lái xe đón khách đúng loại xe đăng ký. Ngay khi lái xe nhận chuyến, hệ thống tự động gửi SMS cho khách hàng số ĐT, biển số xe và loại xe cho khách hàng.</p>\r\n<p> + Lái xe vi phạm lần đầu phạt 200,000vnđ và khóa tài khoản 15 ngày.</p>\r\n<p> + Lái xe vi phạm lần 2 Khóa tài khoản và ngừng hợp tác.</p>\r\n<ol start=\"3\">\r\n<li>Tác phong:</li>\r\n</ol>\r\n<p>- Lái xe ăn mặc lịch sự, thân thiện, nhiệt tình. Mọi trường hợp phát sinh km hay giá tiền, lái xe liên hệ với tổng đài để giải quyết, không tự ý thu thêm tiền khách hàng.</p>\r\n<p>- Thời gian đón khách:</p>\r\n<p>- Lái xe đón khách đúng giờ, luôn chủ động liên hệ với khách hàng.</p>\r\n<p>- Luôn để điện thoại giữ liên lạc với khách và tổng đài</p>\r\n<p>+ Nếu khách hàng phản ánh về tác phong, thái độ chất lượng phục vụ..., tùy trường hợp sẽ phạt từ 100,000đ hoặc ngừng hợp tác.</p>\r\n<p>+ Đối với dịch vụ xe đưa đón sân bay, Đón khách muộn quá 15 phút sẽ áp dụng mức phạt như sau:</p>\r\n<ul>\r\n<li>Đón khách muộn quá 15 phút, không nhỡ chuyến bay của khách: Phạt 100,000đ</li>\r\n<li>Đón khách muộn quá 15 phút, nhỡ chuyến bay của khách: Lái xe phải bồi thường 100% chi phí vé máy bay của khách</li>\r\n</ul>\r\n<ol start=\"4\">\r\n<li>Quy định trả chuyến, hủy chuyến:</li>\r\n</ol>\r\n<p>- Hạn chế mọi trường hợp trả chuyến</p>\r\n<p>- Tiễn sáng lái xe chủ động liên hệ với khách trước 21h.</p>\r\n<p>- Chuyến tiễn sáng từ 3-8h lái xe không trả chuyến sau 21h.</p>\r\n<p>- Các trường hợp đón tiễn Nội Bài khác, lái xe không trả chuyến trước giờ đón hoặc khởi hành 30 phút.</p>\r\n<p>+ Mọi trường hợp trả chuyến đều bị phạt tối thiểu 20,000đ/lần trả</p>\r\n<p>+ Các trường hợp trả chuyến vi phạm, phạt bằng số tiền chênh mua chuyến, hoặc phải bồi thường thiệt hại 100% cho khách nếu tổng đài không điều kịp.</p>', '', 1, 8, '2017-09-12 07:18:16', 49, '', '2017-09-12 07:20:09', 49, 0, '0000-00-00 00:00:00', '2017-09-12 07:18:16', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 2, 0, '', '', 1, 12, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '');
