(1, 8, 5, '', '2017-08-16 02:48:20', 846, 565, '5e43c6e5a30efde2177d9e1032efad77f24b8f53', '{\"id\":8,\"asset_id\":58,\"parent_id\":\"1\",\"lft\":\"11\",\"rgt\":12,\"level\":1,\"path\":null,\"extension\":\"com_content\",\"title\":\"Th\\u00f4ng b\\u00e1o\",\"alias\":\"thong-bao\",\"note\":\"\",\"description\":\"\",\"published\":\"1\",\"checked_out\":null,\"checked_out_time\":null,\"access\":\"1\",\"params\":\"{\\\"category_layout\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"image_alt\\\":\\\"\\\"}\",\"metadesc\":\"\",\"metakey\":\"\",\"metadata\":\"{\\\"author\\\":\\\"\\\",\\\"robots\\\":\\\"\\\"}\",\"created_user_id\":\"846\",\"created_time\":\"2017-08-16 02:48:20\",\"modified_user_id\":null,\"modified_time\":\"2017-08-16 02:48:20\",\"hits\":\"0\",\"language\":\"*\",\"version\":null}', 0),
(2, 1, 1, '', '2017-08-17 04:47:20', 846, 5742, '2e635b96ffdf9fdc697815d073ca6843b7501db4', '{\"id\":1,\"asset_id\":62,\"title\":\"Top up t\\u00e0i kho\\u1ea3n\",\"alias\":\"top-up-tai-kho-n\",\"introtext\":\"<div>\\r\\n<div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">- N\\u1ed9p ti\\u1ec1n m\\u1eb7t ho\\u1eb7c chuy\\u1ec3n kho\\u1ea3n.<br \\/><\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">- N\\u1ed9i dung:\\u00a0<b><span style=\\\"color: #0000ff;\\\">NBC<\\/span><\\/b><span style=\\\"color: #0000ff;\\\">\\u00a0<\\/span><span style=\\\"color: #0000ff;\\\"><b>S\\u1ed1 \\u0111i\\u1ec7n tho\\u1ea1i \\u0111\\u0103ng k\\u00fd<\\/b>\\u00a0<\\/span><b><span style=\\\"color: #0000ff;\\\">NBC<\\/span>\\u00a0+\\u00a0<span style=\\\"color: #000000;\\\">T\\u00ean l\\u00e1i xe<\\/span>\\u00a0<\\/b>n\\u1ed9p ti\\u1ec1n bid.<br \\/><\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">- Ti\\u1ec1n s\\u1ebd\\u00a0<span style=\\\"color: #ff0000;\\\"><b>T\\u1ef0 \\u0110\\u1ed8NG<\\/b><\\/span>\\u00a0\\u0111\\u01b0\\u1ee3c \\u0111\\u1ea9y v\\u00e0o TK BID sau kho\\u1ea3ng 10 - 15 ph\\u00fat k\\u1ec3 t\\u1eeb khi ti\\u1ec1n n\\u1ed5i tr\\u00ean sao k\\u00ea t\\u00e0i kho\\u1ea3n.<\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">\\u00a0<\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\"><span style=\\\"color: #000000;\\\">V\\u00ed d\\u1ee5:\\u00a0<\\/span><span style=\\\"color: #0000ff;\\\"><b>NBC<\\/b>\\u00a00912345678\\u00a0<\\/span><b><span style=\\\"color: #0000ff;\\\">NBC<\\/span>\\u00a0<\\/b><span style=\\\"color: #000000;\\\">\\u00a0Long Nam \\u0110\\u1ecbnh n\\u1ed9p ti\\u1ec1n bid.<\\/span><br \\/><\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">\\u00a0<\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\"><b>N\\u1ebfu n\\u1ed9i dung n\\u1ed9p ti\\u1ec1n <span style=\\\"color: #0000ff;\\\">kh\\u00f4ng \\u0111\\u00fang<\\/span>:<\\/b><\\/span><\\/div>\\r\\n<\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">- Ti\\u1ec1n s\\u1ebd kh\\u00f4ng t\\u1ef1 \\u0111\\u1ed9ng topup m\\u00e0 s\\u1ebd\\u00a0<\\/span><span style=\\\"font-family: \'times new roman\';\\\">\\u0111\\u01b0\\u1ee3c \\u0111\\u1ea9y th\\u1ee7 c\\u00f4ng\\u00a0<\\/span><span style=\\\"font-family: \'times new roman\';\\\"><b><span style=\\\"color: #ff0000;\\\">1 l\\u1ea7n<\\/span><\\/b> v\\u00e0o kho\\u1ea3ng<\\/span><span style=\\\"font-family: \'times new roman\';\\\">\\u00a04.00pm\\u00a0\\u0111\\u1ebfn\\u00a05.00pm\\u00a0c\\u00f9ng ng\\u00e0y (b\\u1eaft \\u0111\\u1ea7u \\u00e1p d\\u1ee5ng t\\u1eeb 18\\/7)<\\/span><\\/div>\\r\\n<\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">- S\\u1ed1 ti\\u1ec1n topup t\\u1ed1i thi\\u1ec3u:\\u00a0<b><span style=\\\"color: #000000;\\\">500.000\\u0111\\/l\\u1ea7n<\\/span><\\/b><br \\/><\\/span><\\/div>\\r\\n<div><span style=\\\"color: #000000; font-family: \'times new roman\';\\\">\\u00a0<\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\"><span style=\\\"color: #000000;\\\">K\\u1ebf to\\u00e1n<\\/span><span style=\\\"color: #000000;\\\"><b>:\\u00a0024.36.888.444 <\\/b>(trong gi\\u1edd h\\u00e0nh ch\\u00ednh, ngh\\u1ec9 tr\\u01b0a t\\u1eeb 12pm \\u0111\\u1ebfn 13pm)<\\/span><br \\/><\\/span><\\/div>\\r\\n<div>\\r\\n<div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">\\u00a0<\\/span><\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">- T\\u00ean t\\u00e0i kho\\u1ea3n:\\u00a0<b>L\\u00ea \\u0110\\u1ee9c C\\u01b0\\u1eddng<\\/b><br \\/><\\/span><\\/div>\\r\\n<div><span style=\\\"font-family: \'times new roman\';\\\">-\\u00a0<span style=\\\"color: #008000;\\\"><b>Vietinbank<\\/b><\\/span>: 1090 0085 6211 - Chi nh\\u00e1nh B\\u1eafc Th\\u0103ng Long.<br \\/><\\/span><\\/div>\\r\\n<div><span style=\