(17, 4, 1, '', '2017-09-06 09:14:12', 1, 5172, '5fef5f93da12af20b28653bebda424493ed39d67', '{\"id\":4,\"asset_id\":\"65\",\"title\":\"Ch\\u01b0\\u01a1ng tr\\u00ecnh \\u0111\\u1ea1i l\\u00fd\",\"alias\":\"chuong-trinh-d-i-ly\",\"introtext\":\"<p class=\\\"item item-text-wrap ng-binding\\\">1. H\\u1ed7 tr\\u1ee3 ae l\\u00e1i xe \\u0111i\\u1ec1u l\\u1ecbch ri\\u00eang c\\u1ee7a m\\u00ecnh.<\\/p>\\r\\n<div>\\u00a0<\\/div>\\r\\n<div>2. L\\u00e1i xe b\\u1eafn l\\u1ecbch cho YCar:<\\/div>\\r\\n<div><span style=\\\"color: #008080;\\\"><b>\\u00a0<\\/b><\\/span><\\/div>\\r\\n<div><span style=\\\"color: #008000;\\\"><b>a. L\\u1ee3i \\u00edch:<\\/b><\\/span><\\/div>\\r\\n<div>- L\\u1ecbch s\\u1ebd \\u0111\\u01b0\\u1ee3c \\u0111i\\u1ec1u sao cho <span style=\\\"color: #ff6600;\\\">TI\\u1ec0N C\\u1eaeT CAO NH\\u1ea4T<\\/span><\\/div>\\r\\n<div>- T\\u1ef7 l\\u1ec7 \\u0103n chia: L\\u00e1i xe\\u00a0<b><span style=\\\"color: #0000ff;\\\">(50%)<\\/span><\\/b>\\u00a0&amp; NBC\\u00a0<b><span style=\\\"color: #0000ff;\\\">(50%)<\\/span><\\/b> v\\u00e0 ph\\u00ed cho NBC <span style=\\\"color: #ff6600;\\\"><b>T\\u1ed0I \\u0110A:\\u00a0100.000\\u0111<\\/b><\\/span> v\\u00e0\\u00a0<span style=\\\"color: #ff6600;\\\">T\\u1ed0I THI\\u1ec2U:\\u00a0<b>20.000\\u0111\\/l\\u1ecbch<\\/b><\\/span><\\/div>\\r\\n<div>- To\\u00e0n b\\u1ed9 ti\\u1ec1n c\\u1eaft s\\u1ebd \\u0111\\u01b0\\u1ee3c th\\u1ec3 hi\\u1ec7n r\\u00f5 r\\u00e0ng trong \\\"<span style=\\\"color: #ff6600;\\\">TK B\\u1eaeN L\\u1ecaCH<\\/span>\\\", \\u0111\\u01b0\\u1ee3c t\\u1ed5ng k\\u1ebft h\\u00e0ng th\\u00e1ng v\\u00e0 thanh to\\u00e1n trong v\\u00f2ng 10 ng\\u00e0y c\\u1ee7a th\\u00e1ng ti\\u1ebfp theo.<\\/div>\\r\\n<div>- NBC s\\u1ebd \\u0111i\\u1ec1u xe \\u0111\\u00fang y\\u00eau c\\u1ea7u v\\u00e0 \\u0111\\u00fang gi\\u1edd.<\\/div>\\r\\n<div>- L\\u1ecbch kh\\u00f4ng thu ti\\u1ec1n, YCar ch\\u1ec9 thu ph\\u00ed <span style=\\\"color: #ff0000;\\\">30.000\\u0111\\/l\\u1ecbch<\\/span> s\\u00e2n bay v\\u00e0 <span style=\\\"color: #