(19, 2, 1, '', '2017-09-06 09:15:28', 1, 5394, 'e47d18848f88fff7d9908ee41b7ac28ae41d2297', '{\"id\":2,\"asset_id\":\"63\",\"title\":\"X\\u1eed l\\u00fd h\\u00f3a \\u0111\\u01a1n t\\u00e0i ch\\u00ednh\",\"alias\":\"x-ly-hoa-don-tai-chinh\",\"introtext\":\"<div>\\u0110\\u1ed1i v\\u1edbi c\\u00e1c l\\u1ecbch y\\u00eau c\\u1ea7u h\\u00f3a \\u0111\\u01a1n YCar ph\\u1ea3i x\\u1eed l\\u00fd cho kh\\u00e1ch thay l\\u00e1i xe, YCar s\\u1ebd \\u00e1p d\\u1ee5ng m\\u1ed9t trong 2 ph\\u01b0\\u01a1ng \\u00e1n:<\\/div>\\r\\n<div>+\\u00a0<span style=\\\"color: #0000ff;\\\"><b>Ph\\u01b0\\u01a1ng \\u00e1n 10%<\\/b><\\/span>\\u00a0= 10% c\\u01b0\\u1edbc.<\\/div>\\r\\n<div>+\\u00a0<span style=\\\"color: #ff0000;\\\"><b>Ph\\u01b0\\u01a1ng \\u00e1n 20%<\\/b><\\/span>\\u00a0= 20% c\\u01b0\\u1edbc.<\\/div>\\r\\n<div>+ Ph\\u00ed chuy\\u1ec3n ph\\u00e1t = <b><span style=\\\"color: #0000ff;\\\">0 \\u0111\\u1ed3ng (<\\/span><\\/b><b><span style=\\\"color: #0000ff;\\\">do YCar xu\\u1ea5t h\\u00f3a \\u0111\\u01a1n \\u0111i\\u1ec7n t\\u1eed<\\/span><\\/b>)<\\/div>\\r\\n<div>\\u00a0<\\/div>\\r\\n<p class=\\\"item item-text-wrap ng-binding\\\">- L\\u1ecbch\\u00a0<b>h\\u00f3a \\u0111\\u01a1n ngay<\\/b>: L\\u00e1i xe ph\\u1ea3i x\\u1eed l\\u00fd \\u0111\\u1ec3 kh\\u00e1ch kh\\u00f4ng g\\u1ecdi l\\u00ean YCar \\u0111\\u00f2i h\\u00f3a \\u0111\\u01a1n. N\\u1ebfu kh\\u00e1ch g\\u1ecdi l\\u00ean \\u0111\\u00f2i h\\u00f3a \\u0111\\u01a1n th\\u00ec YCar s\\u1ebd th\\u1ef1c hi\\u1ec7n xu\\u1ea5t lu\\u00f4n h\\u00f3a \\u0111\\u01a1n cho kh\\u00e1ch v\\u00e0 c\\u1eaft ti\\u1ec1n theo ph\\u01b0\\u01a1ng \\u00e1n\\u00a0<b>20%<\\/b>.<\\/p>\\r\\n<div>\\u00a0<\\/div>\\r\\n<div>- L\\u1ecbch\\u00a0<b>kh\\u00f4ng y\\u00eau c\\u1ea7u h\\u00f3a \\u0111\\u01a1n ngay<\\/b>:<\\/div>\\r\\n<div>+ N\\u1ebfu l\\u00e1i xe c\\u00f3 th\\u1ec3 xu\\u1ea5t lu\\u00f4n h\\u00f3a \\u0111\\u01a1n cho kh\\u00e1ch nh\\u01b0ng kh\\u00e1ch kh\\u00f4ng mu\\u1ed1n l\\u1ea5y lu\\u00f4n m\\u00e0 y\\u00eau c\\u1ea7u g\\u1eedi cho kh\\u00e1ch sau, l\\u00e1i xe \\u0111\\u01b0\\u1ee3c ph\\u00e9p thu\\u00a0<b>10.000\\u0111 ph\\u00ed chuy\\u1ec3n ph\\u00e1t<\\/b>\\u00a0\\u0111\\u1ec3 c\\u00f3 chi ph\\u00ed chuy\\u1ec3n ph\\u00e1t h\\u00f3a \\u0111\\u01a1n cho kh\\u00e1ch.<\\/div>\\r\\n<div>+ N\\u1ebfu l\\u00e1i xe kh\\u00f4ng th\\u1ec3 xu\\u1ea5t h\\u00f3a \\u0111\\u01a1n lu\\u00f4n cho kh\\u00e1ch th\\u00ec ph\\u1ea3i x\\u1eed l\\u00fd d\\u1ee9t \\u0111i\\u1ec3m v\\u1edbi kh\\u00e1ch trong v\\u00f2ng\\u00a0<b><span style=\\\"color: #008000;\\\">05 ng\\u00e0y l\\u00e0m vi\\u1ec7c<\\/span><\\/b>\\u00a0k\\u1ec3 t\\u1eeb ng\\u00e0y \\u0111\\u00f3n kh\\u00e1ch.\\u00a0<b><span style=\\\"color: #0000ff;\\\">Sau 05 ng\\u00e0y l\\u00e0m vi\\u1ec7c<\\/span><\\/b>, n\\u1ebfu kh\\u00e1ch v\\u1eabn ch\\u01b0a nh\\u1eadn \\u0111\\u01b0\\u1ee3c h\\u00f3a \\u0111\\u01a1n <b><span style=\\\"color: #0000ff;\\\">v\\u00ec b\\u1ea5t c\\u1ee9 l\\u00fd do g\\u00ec<\\/span><\\/b>, c\\u00f4ng ty s\\u1ebd xu\\u1ea5t h\\u00f3a \\u0111\\u01a1n cho kh\\u00e1ch v\\u00e0 c\\u1eaft ti\\u1ec1n l\\u00e1i xe theo ph\\u01b0\\u01a1ng \\u00e1n\\u00a0<b>20%<\\/b>.<\\/div>\\r\\n<div>+ N\\u1ebfu l\\u00e1i xe kh\\u00f4ng th\\u1ec3 xu\\u1ea5t \\u0111\\u01b0\\u1ee3c h\\u00f3a \\u0111\\u01a1n th\\u00ec c\\u00f3 th\\u1ec3 ch\\u1ee7 \\u0111\\u1ed9ng nh\\u1edd YCar x\\u1eed l\\u00fd lu\\u00f4n v\\u00e0 YCar s\\u1ebd c\\u1eaft ti\\u1ec1n theo ph\\u01b0\\u01a1ng \\u00e1n\\u00a0<span style=\\\"color: #0000ff;\\\"><b>10%<\\/b><\\/span>\\u00a0(<i><b>ch\\u1ec9 \\u00e1p d\\u1ee5ng n\\u1ebfu l\\u00e1i xe ch\\u1ee7 \\u0111\\u1ed9ng y\\u00eau c\\u1ea7u YCar tr\\u01b0\\u1edbc khi kh\\u00e1ch g\\u1ecdi l\\u00ean<\\/b><\\/i>). YCar s\\u1ebd xu\\u1ea5t lu\\u00f4n cho kh\\u00e1ch trong gi\\u1edd h\\u00e0nh ch\\u00ednh b\\u1eb1ng h\\u00f3a \\u0111\\u01a1n \\u0111i\\u1ec7n t\\u1eed.<\\/div>\\r\\n<div>\\u00a0<\\/div>\\r\\n<div>Khi th\\u1ef1c hi\\u1ec7n c\\u1eaft ti\\u1ec1n h\\u00f3a \\u0111\\u01a1n, YCar s\\u1ebd g\\u1ecdi \\u0111i\\u1ec7n th\\u00f4ng b\\u00e1o v\\u00e0 SMS cho l\\u00e1i xe \\u0111\\u1ec3 l\\u00e1i xe n\\u1eafm \\u0111\\u01b0\\u1ee3c.<\\/div>\\r\\n<div>\\u00a0<\\/div>\\r\\n<div>\\u00c1p d\\u1ee5ng t\\u1eeb 6\\/4\\/2017.<\\/div>\\r\\n<div>Tr\\u00e2n tr\\u1ecdng c\\u1ea3m \\u01a1n.<\\/div>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2017-08-17 04:47:58\",\"created_by\":\"846\",\"created_by_alias\":\"\",\"modified\":\"2017-09-06 09:15:28\",\"modified_by\":\"1\",\"checked_out\":\"1\",\"checked_out_time\":\"2017-09-06 09:14:48\",\"publish_up\":\"2017-08-17 04:47:58\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_optio