(22, 8, 1, '', '2017-09-12 07:18:16', 49, 5699, '87cbdecb50afced967f1dec250ff788624756d0a', '{\"id\":8,\"asset_id\":76,\"title\":\"QUY \\u0110\\u1ecaNH L\\u00c1I XE\",\"alias\":\"quy-dinh-lai-xe\",\"introtext\":\"<p><strong>QUY \\u0110\\u1ecaNH L\\u00c1I XE<\\/strong><\\/p>\\r\\n<ol>\\r\\n<li>L\\u00e1i xe kh\\u00f4ng ti\\u1ebfp th\\u1ecb kh\\u00e1ch.<\\/li>\\r\\n<\\/ol>\\r\\n<p>- L\\u00e1i xe tuy\\u1ec7t \\u0111\\u1ed1i kh\\u00f4ng ti\\u1ebft l\\u1ed9 gi\\u00e1 nh\\u1eadn chuy\\u1ebfn, kh\\u00f4ng ti\\u1ebfp th\\u1ecb hay m\\u1eddi kh\\u00e1ch.<\\/p>\\r\\n<ol start=\\\"2\\\">\\r\\n<li>L\\u00e1i xe \\u0111\\u00f3n \\u0111\\u00fang lo\\u1ea1i xe \\u0111\\u0103ng k\\u00fd.<\\/li>\\r\\n<\\/ol>\\r\\n<p>- Tuy\\u1ec7t \\u0111\\u1ed1i kh\\u00f4ng mua h\\u1ed9 chuy\\u1ebfn khi ch\\u01b0a c\\u00f3 s\\u1ef1 \\u0111\\u1ed3ng \\u00fd c\\u1ee7a t\\u1ed5ng \\u0111\\u00e0i.<\\/p>\\r\\n<p>- L\\u00e1i xe \\u0111\\u00f3n kh\\u00e1ch \\u0111\\u00fang lo\\u1ea1i xe \\u0111\\u0103ng k\\u00fd. Ngay khi l\\u00e1i xe nh\\u1eadn chuy\\u1ebfn, h\\u1ec7 th\\u1ed1ng t\\u1ef1 \\u0111\\u1ed9ng g\\u1eedi SMS cho kh\\u00e1ch h\\u00e0ng s\\u1ed1 \\u0110T, bi\\u1ec3n s\\u1ed1 xe v\\u00e0 lo\\u1ea1i xe cho kh\\u00e1ch h\\u00e0ng.<\\/p>\\r\\n<p>\\u00a0+ L\\u00e1i xe vi ph\\u1ea1m l\\u1ea7n \\u0111\\u1ea7u ph\\u1ea1t 200,000vn\\u0111 v\\u00e0 kh\\u00f3a t\\u00e0i kho\\u1ea3n 15 ng\\u00e0y.<\\/p>\\r\\n<p>\\u00a0+ L\\u00e1i xe vi ph\\u1ea1m l\\u1ea7n 2 Kh\\u00f3a t\\u00e0i kho\\u1ea3n v\\u00e0 ng\\u1eebng h\\u1ee3p t\\u00e1c.<\\/p>\\r\\n<ol start=\\\"3\\\">\\r\\n<li>T\\u00e1c phong:<\\/li>\\r\\n<\\/ol>\\r\\n<p>- L\\u00e1i xe \\u0103n m\\u1eb7c l\\u1ecbch s\\u1ef1, th\\u00e2n thi\\u1ec7n, nhi\\u1ec7t t\\u00ecnh. M\\u1ecdi tr\\u01b0\\u1eddng h\\u1ee3p ph\\u00e1t sinh km hay gi\\u00e1 ti\\u1ec1n, l\\u00e1i xe li\\u00ean h\\u1ec7 v\\u1edbi t\\u1ed5ng \\u0111\\u00e0i \\u0111\\u1ec3 gi\\u1ea3i quy\\u1ebft, kh\\u00f4ng t\\u1ef1 \\u00fd thu th\\u00eam ti\\u1ec1n kh\\u00e1ch h\\u00e0ng.<\\/p>\\r\\n<p>- Th\\u1eddi gian \\u0111\\u00f3n kh\\u00e1ch:<\\/p>\\r\\n<p>- L\\u00e1i xe \\u0111\\u00f3n kh\\u00e1ch \\u0111\\u00fang gi\\u1edd, lu\\u00f4n ch\\u1ee7 \\u0111\\u1ed9ng li\\u00ean h\\u1ec7 v\\u1edbi kh\\u00e1ch h\\u00e0ng.<\\/p>\\r\\n<p>- Lu\\u00f4n \\u0111\\u1ec3 \\u0111i\\u1ec7n tho\\u1ea1i gi\\u1eef li\\u00ean l\\u1ea1c v\\u1edbi kh\\u00e1ch v\\u00e0 t\\u1ed5ng \\u0111\\u00e0i<\\/p>\\r\\n<p>+ N\\u1ebfu kh\\u00e1ch h\\u00e0ng ph\\u1ea3n \\u00e1nh v\\u1ec1 t\\u00e1c phong, th\\u00e1i \\u0111\\u1ed9 ch\\u1ea5t l\\u01b0\\u1ee3ng ph\\u1ee5c v\\u1ee5..., t\\u00f9y tr\\u01b0\\u1eddng h\\u1ee3p s\\u1ebd ph\\u1ea1t t\\u1eeb 100,000\\u0111 ho\\u1eb7c ng\\u1eebng h\\u1ee3p t\\u00e1c.<\\/p>\\r\\n<p>+ \\u0110\\u1ed1i v\\u1edbi d\\u1ecbch v\\u1ee5 xe \\u0111\\u01b0a \\u0111\\u00f3n s\\u00e2n bay, \\u0110\\u00f3n kh\\u00e1ch mu\\u1ed9n qu\\u00e1 15 ph\\u00fat s\\u1ebd \\u00e1p d\\u1ee5ng m\\u1ee9c ph\\u1ea1t nh\\u01b0 sau:<\\/p>\\r\\n<ul>\\r\\n<li>\\u0110\\u00f3n kh\\u00e1ch mu\\u1ed9n qu\\u00e1 15 ph\\u00fat, kh\\u00f4ng nh\\u1ee1 chuy\\u1ebfn bay c\\u1ee7a kh\\u00e1ch: Ph\\u1ea1t 100,000\\u0111<\\/li>\\r\\n<li>\\u0110\\u00f3n kh\\u00e1ch mu\\u1ed9n qu\\u00e1 15 ph\\u00fat, nh\\u1ee1 chuy\\u1ebfn bay c\\u1ee7a kh\\u00e1ch: L\\u00e1i xe ph\\u1ea3i b\\u1ed3i th\\u01b0\\u1eddng 100% chi ph\\u00ed v\\u00e9 m\\u00e1y bay c\\u1ee7a kh\\u00e1ch<\\/li>\\r\\n<\\/ul>\\r\\n<ol start=\\\"4\\\">\\r\\n<li>Quy \\u0111\\u1ecbnh tr\\u1ea3 chuy\\u1ebfn, h\\u1ee7y chuy\\u1ebfn:<\\/li>\\r\\n<\\/ol>\\r\\n<p>- H\\u1ea1n ch\\u1ebf m\\u1ecdi tr\\u01b0\\u1eddng h\\u1ee3p tr\\u1ea3 chuy\\u1ebfn<\\/p>\\r\\n<p>- Ti\\u1ec5n s\\u00e1ng l\\u00e1i xe ch\\u1ee7 \\u0111\\u1ed9ng li\\u00ean h\\u1ec7 v\\u1edbi kh\\u00e1ch tr\\u01b0\\u1edbc 21h.<\\/p>\\r\\n<p>- Chuy\\u1ebfn ti\\u1ec5n s\\u00e1ng t\\u1eeb 3-8h l\\u00e1i xe kh\\u00f4ng tr\\u1ea3 chuy\\u1ebfn sau 21h.<\\/p>\\r\\n<p>- C\\u00e1c tr\\u01b0\\u1eddng h\\u1ee3p \\u0111\\u00f3n ti\\u1ec5n N\\u1ed9i B\\u00e0i kh\\u00e1c, l\\u00e1i xe kh\\u00f4ng tr\\u1ea3 chuy\\u1ebfn tr\\u01b0\\u1edbc gi\\u1edd \\u0111\\u00f3n ho\\u1eb7c kh\\u1edfi h\\u00e0nh 30 ph\\u00fat.<\\/p>\\r\\n<p>+ M\\u1ecdi tr\\u01b0\\u1eddng h\\u1ee3p tr\\u1ea3 chuy\\u1ebfn \\u0111\\u1ec1u b\\u1ecb ph\\u1ea1t t\\u1ed1i thi\\u1ec3u 20,000\\u0111\\/l\\u1ea7n tr\\u1ea3<\\/p>\\r\\n<p>+ C\\u00e1c tr\\u01b0\\u1eddng h\\u1ee3p tr\\u1ea3 chuy\\u1ebfn vi ph\\u1ea1m, ph\\u1ea1t b\\u1eb1ng s\\u1ed1 ti\\u1ec1n ch\\u00eanh mua chuy\\u1ebfn, ho\\u1eb7c ph\\u1ea3i b\\u1ed3i th\\u01b0\\u1eddng thi\\u1ec7t h\\u1ea1i 100% cho kh\\u00e1ch n\\u1ebfu t\\u1ed5ng \\u0111\\u00e0i kh\\u00f4ng \\u0111i\\u1ec1u k\\u1ecbp.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2017-09-12 07:18:16\",\"created_by\":\"49\",\"created_by_alias\":\"\",\"modified\":\"2017-09-12 07:18:16\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2017-09-12 07:18:16\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\